import "./ToMesh.css";
import React from "react";
import BrowserViewInfo from "common/components/BrowserViewInfo";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import Desktop_Title from "modules/toMesh/components/tmIntro";
import Header from "modules/toMesh/components/tmTitle";

const ToMesh = () => {
  let content = <Desktop_Title />;
  return (
    <>
      <Header></Header>
      <BrowserView>
        <h1>{content}</h1>
      </BrowserView>
      <MobileOnlyView>
        <h1>{content}</h1>
      </MobileOnlyView>
    </>
  );
};

export default ToMesh;
